import React from 'react';
import './App.css';
import Home from './Components/Home'
import Contacts from './Components/Contacts'
import { Icon } from 'semantic-ui-react'




function App() {
  return (
    <React.Fragment>
      <Contacts/>
      <Home/>
      <Icon name="th list" textAlign="center"/>
    </React.Fragment>


  );
}

export default App;
